import { IgrStackedColumnSeries } from "./igr-stacked-column-series";
import { Stacked100ColumnSeries } from "./Stacked100ColumnSeries";
/**
 * Represents a IgxDataChartComponent stacked100 column series.
*/
export class IgrStacked100ColumnSeries extends IgrStackedColumnSeries {
    createImplementation() {
        return new Stacked100ColumnSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    get isPercentBased() {
        return this.i.aa4;
    }
}
